import "gridjs/dist/theme/mermaid.css";

import { Grid } from 'gridjs-react';


    import React, { Component } from 'react'

    export default class Table extends Component {
        render() {
            return (
                <Grid
                data={[
                  ['John', 'john@example.com',`Zimbabwe`,'Yes'],
                  ['Mike', 'mike@gmail.com']
                ]}
                columns={['Name','Country','Sex','Married']}
                search={true}
                pagination={{
                  enabled: true,
                  limit: 1,
                }}
              />
            )
        }
    }
